import React from 'react';
import { Link } from 'react-router-dom';
import { restaurants } from '.';

const RestaurantListing = () => {
    return (
        <div className="p-6 bg-gray-100 min-h-screen">
            <h1 className="text-3xl font-extrabold text-gray-800 mb-6">Available Restaurants</h1>
            <ul className="space-y-4">
                {restaurants.map((restaurant) => (
                    <li key={restaurant.id} className="p-4 bg-white shadow-md rounded-lg hover:shadow-lg transition-shadow">
                        <Link
                            to={`/menu/${restaurant.id}`}
                            className="text-xl font-semibold text-blue-600 hover:text-blue-800"
                        >
                            {restaurant.name}
                        </Link>
                        <p className="text-gray-600">
                            {restaurant.cuisine} Cuisine, {restaurant.location}
                        </p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default RestaurantListing;
